import { Row } from 'antd';
import Post from '../components/Post';

function Posts() {
  const posts = [
    {
      id: '1',
      title: 'My first post',
      description: 'My first description',
      menu: 'Todays menu!',
    },
  ];
  return (
    <Row
      style={{
        justifyContent: 'center',
        alignContent: 'center',
      }}
    >
      {posts.map((post) => (
        <Post key={post.id} title={post.title} description={post.description} />
      ))}
    </Row>
  );
}

export default Posts;
